import React from 'react';
import styles from'./Navbar.module.css'
import { Col } from 'react-bootstrap';


const Navbar = () =>{
    return(
        <Col xs='2' className={styles.nav_items_col}>
          <ul className={styles.nav_ul}>
            <li><a href='/profile' className={styles.nav_item}>Profile</a></li>
            <li><a href='/diaologs' className={styles.nav_item}>Messages</a></li>
            <li><a href='#1' className={styles.nav_item}>News</a></li>
            <li><a href='#1' className={styles.nav_item}>Settings</a></li>
            <li><a href='#1' className={styles.nav_item}>Music</a></li>
          </ul>
        </Col>
    )
}
export default Navbar;
